import React from "react";
import DisplayUser from "./DisplayUser";
const ShowUser=(props)=>{
   const list=[...props.users];

    

    
return <div>
    {
 list.forEach(i => (
 
    <DisplayUser name={i.name} age={i.age} ></DisplayUser>
   
 ))
    }
    
 
     </div>






}
export default ShowUser;
